text:
AI governance is an area of the mainstream of computer science that focuses on how to constrain and influence the actions and behavior of individuals, entities, companies, and institutions.  AI governance states that:
1. humans should be able to shape the future of the world;
2. businesses and organizations support the behavior of AI;
3. AI will help improve the lives of people using data, hardware, software, and other technology;
4. AI will act on behalf of human beings, both as users and developers;
5. AI will help create great ideas in the fields of robotics, machine learning, machine learning, biotechnology, and health;
6. AI can increase people's chances of making good decisions based on the knowledge they have gained;
7. AI can reduce poverty and disease disparities; and
8. AI can inform decision-making.
